    shuffle(array) {
        let counter = array.length;
        while (counter > 0) {
          let index = Math.floor(Math.random() * counter);
          counter --;
          let temp = array[counter];
          array[counter] = array[index];
          array[index] = temp;
        }
        return array;
    }

    countSteps() {
      this.steps++;
      this.calcScore();
  }

  calcScore(){
    const rating3 = (this.cards.length/2) + 2,
      rating2 = (this.cards.length);
    //   rating1 = (cards.length * 3);

      const is3Stars = this.steps <= rating3,
            is2Stars = this.steps > rating3 && this.steps <=rating2,
            is1Stars = this.steps > rating2;

    if (is3Stars) {
      this.score = 3;
    }
    if (is2Stars) {
      this.score = 2;
    }
    if (is1Stars) {
      this.score = 1;
    }

}



